import { useState } from "react"
import "./LogsWindow.css"
import React from "react"
import { SingleLog } from "./LogWindow.style"


type Logs = {
    logList:string[],
    handleLogList: (arg:string[])=>void
}

export const LogsWindow = (props:Logs)=>{

    const [clickedLog, setClickedLog] = useState<string>("")

    return (
        <>
            <div className="log-container">
            <div>Clicked Log: {clickedLog}</div>
                {props.logList?props.logList.map((log)=><button className="log-instance" onClick={()=>{setClickedLog(log)}}>{log}</button>):""}
            </div>
        </>
    )

}
